utionall clients, includig pension funds, insurance companies, institutional clients and private banking clients from Asia Pacific, Europe and America.','The investment team is headed by Winson Fong, Chief Investment Officer, who has more than 20 years of investment experience. The investment management and decision making process is based on a team approach. The resources and insight from our market specialists are pooled together which allow us to react quickly to market changes. This has contributed to the positive performance of our portfolios. All of our fund managers are local market specialists and have in-depth knowledge of the markets they cover, f','2013-05-04 00:00:24','2013-05-03 17:00:25'),(135,11,2,'Spinnaker Capital Group','Hedge Fund',150.2,'+44 20 7903 2999','-','+44 20 7903 2900','email@company-name.com','-','www.spinnakercapital.com','-','Spinnaker Capital Group is a London, England - based investment advisor / hedge fund firm. The firm manages the Spinnaker Global Emerging Markets Fund and Spinnaker Global Opportunity Fund.','Spinnaker Capital Group uses fundamental research. The firm invests in emerging markets and speciality.','2013-05-04 00:00:24','2013-05-03 17:00:25'),(136,7,2,'Stark Investments (UK) Limited','Investment Management',151.2,'+44 20 7647 9043','-','+44 20 7647 9040','email@company-name.com','-','www.starkinvestments.com','-','Stark Investments (UK) Limited is a London, England - based investment management firm. Stark is a global alternative investment firm providing multi-asset investment capabilities through a diverse array of fundamental and quantitative strategies to investors worldwide. We invest on behalf of qualified institutions, funds of funds, family offices and high net worth individuals. The primary investment objective is to achieve attractive returns, while seeking to limit risk, through sophisticated hedging and ortfolio management techniques. Stark Investments, headquartered in Milwaukee, Wisconsin, was founded 